import axios from "axios";
import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { apiUrl } from "../axios";
import { jwtDecode } from "jwt-decode"; // Correct named import

export default function Login() {
  const navigate = useNavigate();
  const [formvalues, setformvalues] = useState({});
  const [formError, setFromError] = useState("");

  const onChangeHandler = (e) => {
    setformvalues({ ...formvalues, [e.target.name]: e.target.value });
  };

  const onSubmit = (e) => {
    e.preventDefault();
    axios
      .post(apiUrl + "/medical_store_app/login/", formvalues)
      .then((response) => {
        sessionStorage.setItem("access_token", response.data.access);
        sessionStorage.setItem("refresh_token", response.data.refresh);

        // Correct usage of jwtDecode
        var user = jwtDecode(response.data.access);
        var userId = user.user_id;
        var username = user.name;
        var user_type = user.user_type;

        axios.defaults.headers.common["Authorization"] = `Bearer ${response.data.access}`;

        sessionStorage.setItem("user_id", userId);
        sessionStorage.setItem("name", username);
        sessionStorage.setItem("user_type", user_type);

        if (user_type === "admin") navigate("/Admin/DashBoard");
        else if (user_type === "user") navigate("/User/DashBord");
      })
      .catch((error) => {
        if (error.response.status === 401) {
          setFromError(error.response.data.detail);
        }
      });
  };

  // Styles object
  const styles = {
    container: {
      maxWidth: "50%",
      margin: "auto",
      padding: "2rem",
      boxShadow: "2px 3px 8px rgba(0, 0, 0, 0.2)",
      backgroundColor: "lightblue",
      borderRadius: "10px",
    },
    form: {
      display: "flex",
      flexDirection: "column",
    },
    heading: {
      fontSize: "1.5rem",
      color: "#333",
    },
    label: {
      fontWeight: "bold",
      color: "#333",
    },
    input: {
      padding: "10px",
      fontSize: "1rem",
      border: "1px solid #ccc",
      borderRadius: "5px",
    },
    errorText: {
      color: "red",
    },
    registerLink: {
      color: "#007bff",
    },
    button: {
      padding: "10px",
      fontSize: "1rem",
    },
  };

  return (
    <div>
      <div className="container mt-5 p-4" style={styles.container}>
        <form onSubmit={onSubmit} method="post" className="form" style={styles.form}>
          <div className="row mt-3 mb-3">
            <h4 className="text-center" style={styles.heading}>
              <i className="bi bi-person-circle px-3"></i>Login
            </h4>
          </div>
          <div className="row mb-3">
            <div className="col">
              <label htmlFor="" className="form-label" style={styles.label}>
                UserName
              </label>
              <input
                type="text"
                name="username"
                placeholder="username"
                className="form-control"
                style={styles.input}
                onChange={onChangeHandler}
              />
            </div>
          </div>
          <div className="row mb-3">
            <div className="col">
              <label htmlFor="" className="form-label" style={styles.label}>
                Password
              </label>
              <input
                type="password"
                name="password"
                placeholder="password"
                className="form-control"
                style={styles.input}
                onChange={onChangeHandler}
              />
            </div>
          </div>
          <p style={styles.errorText}>{formError}</p>
          <p>
            New User? <a href="register" style={styles.registerLink}>Register here</a>
            <br />
          </p>
          <div className="row mb-3">
            <div className="col">
              <button className="btn btn-dark col-3" style={styles.button}>
                Login
              </button>
            </div>
          </div>
        </form>
      </div>
    </div>
  );
}
